import './index.css';
import './App.css';
import React, { Component } from "react";
import TimeAdder from './TimeAdder';


export default class DisplayList extends Component {
    render() {
        return (
            <div>
                {this.props.list.map(piece =>
                    <div class="image_div">
                        <img src={piece.src} alt="blah" class="image" />
                        <div class="image_desc">
                            <div>
                                <div class="title_and_medium">
                                    <h3 class="name">{piece.name}</h3>
                                    <h3 class="medium">  - {piece.medium}</h3>
                                </div>
                                <h6 class="date">{piece.date}</h6>
                            </div>
                            <h5>{piece.award}</h5>
                            <div class="time">
                                <h6>Total Time: {piece.time} hours</h6>
                                <TimeAdder addTime={this.props.addTime} time={piece.time} img={piece.src} />
                            </div>
                        </div>
                    </div>)

                }
            </div>
        )
    }

}
